import React from 'react';

const Logout = ({ onLogout }) => {
  const handleLogout = () => {
    // 로그아웃 처리 및 토큰 만료 등을 수행하는 부분
    // 예시로, 간단한 로그아웃 상태 업데이트만 수행
    onLogout();
  };

  return (
    <div>
      <h2>Logout</h2>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};

export default Logout;
